//============================================================================
// SERVICIO DE GENERACIÓN DE PDFS PARA COTIZACIONES
//============================================================================
const PdfPrinter = require('pdfmake');

const fonts = {
  Roboto: {
    normal: 'Helvetica',
    bold: 'Helvetica-Bold',
    italics: 'Helvetica-Oblique',
    bolditalics: 'Helvetica-BoldOblique'
  }
};

const printer = new PdfPrinter(fonts);

// --- HELPERS ---
const formatCurrency = (val) => new Intl.NumberFormat('es-AR', { style: 'currency', currency: 'ARS' }).format(val || 0);
const formatDate = (d) => d ? new Date(d).toLocaleDateString('es-AR') : '-';
const formatPct = (v) => (parseFloat(v) || 0) + '%';

// Fechas calculadas
const getFechaCaducidad = (fechaCreacion) => {
    if (!fechaCreacion) return '-';
    const fecha = new Date(fechaCreacion);
    fecha.setDate(fecha.getDate() + 15);
    return formatDate(fecha);
};

const getFechaIngreso = (fechaCreacion) => {
    if (!fechaCreacion) return '-';
    const fecha = new Date(fechaCreacion);
    return formatDate(new Date(fecha.getFullYear(), fecha.getMonth() + 1, 1));
};

// Parser de Tabla
const parsePrestacionesToBody = (texto, colors) => {
    const body = [
        [
            { text: 'PRESTACIÓN', style: 'tableHeaderFilled', fillColor: colors.primary, color: 'white' },
            { text: 'COBERTURA', style: 'tableHeaderFilled', fillColor: colors.primary, color: 'white', alignment: 'center' },
            { text: 'REINTEGRO', style: 'tableHeaderFilled', fillColor: colors.primary, color: 'white', alignment: 'center' }
        ]
    ];
    if (!texto) return body;
    const lineas = texto.toString().split('\n');
    lineas.forEach((linea, index) => {
        if (!linea || !linea.trim()) return;
        let partes = linea.split('|');
        if (partes.length === 1) {
             body.push([{ text: partes[0].trim(), colSpan: 3, style: 'tableRow', fillColor: index % 2 === 0 ? colors.rowOdd : null }, {}, {}]);
        } else {
            body.push([
                { text: partes[0] ? partes[0].trim() : '', style: 'tableRow', fillColor: index % 2 === 0 ? colors.rowOdd : null },
                { text: partes[1] ? partes[1].trim() : '', style: 'tableRowCentered', fillColor: index % 2 === 0 ? colors.rowOdd : null },
                { text: partes[2] ? partes[2].trim() : '', style: 'tableRowCentered', fillColor: index % 2 === 0 ? colors.rowOdd : null }
            ]);
        }
    });
    return body;
};

const generarCotizacionPDF = (cotizacion, res) => {
    try {
        const COLORS = {
            primary: '#0D47A1',
            secondary: '#D4AF37',
            rowOdd: '#F5F5F5',
            text: '#333333',
            border: '#CCCCCC'
        };

        // LOGO PLACEHOLDER 
        const logoAzulBase64 = 'data:image/png;base64,';

        const cliente = cotizacion.cliente || {};
        const plan = cotizacion.plan || {};
        const asesor = cotizacion.asesor || {};
        const direccionCliente = cliente.direccion || cotizacion.cliente_direccion || cliente.ciudad || 'No informada';

        // TABLAS DE DATOS (Pre-cálculo) 
        const bodyMiembros = [[{ text: 'PARENTESCO', style: 'tableHeader', borderColor: [COLORS.primary, COLORS.primary, COLORS.primary, COLORS.primary] }, { text: 'EDAD', style: 'tableHeader', alignment: 'center', borderColor: [COLORS.primary, COLORS.primary, COLORS.primary, COLORS.primary] }, { text: 'VALOR', style: 'tableHeader', alignment: 'right', borderColor: [COLORS.primary, COLORS.primary, COLORS.primary, COLORS.primary] }]];
        cotizacion.miembros?.forEach((m, i) => bodyMiembros.push([{ text: m.parentesco || '', style: 'tableRow', fillColor: i%2===0 ? COLORS.rowOdd : null, border: [false, false, false, false] }, { text: (m.edad || 0) + ' años', style: 'tableRow', alignment: 'center', fillColor: i%2===0 ? COLORS.rowOdd : null, border: [false, false, false, false] }, { text: formatCurrency(m.valor_individual), style: 'tableRow', alignment: 'right', fillColor: i%2===0 ? COLORS.rowOdd : null, border: [false, false, false, false] }]));

        const bodyCostos = [[{ text: 'Valor Base Plan', style: 'costLabel' }, { text: formatCurrency(cotizacion.valor_base_plan), style: 'costValue' }]];
        const addDiscount = (l, p, v) => { if(parseFloat(v) > 0) bodyCostos.push([{ text: `${l} (${formatPct(p)})`, style: 'discountLabel' }, { text: `-${formatCurrency(v)}`, style: 'discountValue' }]); };
        addDiscount('Desc. Comercial', cotizacion.descuento_comercial_pct, cotizacion.valor_descuento_comercial);
        addDiscount('Desc. Afinidad', cotizacion.descuento_afinidad_pct, cotizacion.valor_descuento_afinidad);
        addDiscount('Desc. Tarjeta', cotizacion.descuento_tarjeta_pct, cotizacion.valor_descuento_tarjeta);
        addDiscount('Desc. Joven', cotizacion.descuento_joven_pct, cotizacion.valor_descuento_joven);
        
        bodyCostos.push([{ text: '', colSpan: 2, border: [false, false, false, true], borderColor: '#EEEEEE', margin: [0,5,0,5] }, {}]);
        if(parseFloat(cotizacion.valor_aportes_estimados)>0) bodyCostos.push([{text:'Aportes Estimados (O.S.)',style:'contributionLabel'},{text:`-${formatCurrency(cotizacion.valor_aportes_estimados)}`,style:'contributionValue'}]);
        if(parseFloat(cotizacion.valor_aporte_monotributo)>0) bodyCostos.push([{text:'Aporte Monotributo',style:'contributionLabel'},{text:`-${formatCurrency(cotizacion.valor_aporte_monotributo)}`,style:'contributionValue'}]);
        if(parseFloat(cotizacion.valor_iva)>0) bodyCostos.push([{text:'IVA (10.5%)',style:'costLabel'},{text:`+${formatCurrency(cotizacion.valor_iva)}`,style:'costValue'}]);
        
        bodyCostos.push([{ text: '', colSpan: 2, margin: [0, 5, 0, 5] }, {}]); 
        bodyCostos.push([{ text: 'TOTAL A PAGAR', style: 'totalLabel', fillColor: COLORS.primary, border: [false, false, false, false] }, { text: formatCurrency(cotizacion.valor_total), style: 'totalValue', fillColor: COLORS.primary, border: [false, false, false, false] }]);

        // DEFINICIÓN DEL DOCUMENTO 
        const docDefinition = {
            pageSize: 'A4',
            pageMargins: [40, 110, 40, 80],
            
            header: {
                margin: [40, 30, 40, 0],
                columns: [
                    // Logo + Texto
                    {
                        width: '*',
                        stack: [
                            {
                                columns: [
                                    { width: 'auto', image: logoAzulBase64, width: 60, margin: [0, 0, 15, 0] },
                                    { width: 'auto', stack: [ { text: 'SIGEC', style: 'logoText', color: COLORS.primary, margin: [0, 8, 0, 0] }, { text: 'Medicina Privada', style: 'logoSubText', color: COLORS.secondary } ] }
                                ]
                            },
                            { canvas: [{ type: 'rect', x: 0, y: 8, w: 220, h: 3, color: COLORS.secondary }] }
                        ]
                    },
                    // Info Cotización
                    {
                        width: 'auto',
                        stack: [
                            { text: 'COTIZACIÓN DE PLAN', style: 'headerTitle', alignment: 'right', color: '#333' },
                            { text: `N° ${cotizacion.id || '---'}`, style: 'headerNumber', alignment: 'right', color: COLORS.primary },
                        ]
                    }
                ]
            },

            footer: (currentPage, pageCount) => {
                return {
                    stack: [
                        { canvas: [{ type: 'line', x1: 40, y1: 0, x2: 555, y2: 0, lineWidth: 1, lineColor: COLORS.secondary }] },
                        {
                            columns: [
                                { text: 'www.sigec.com.ar', style: 'footerText', alignment: 'left' },
                                { text: 'Cuidando lo que más importa', style: 'footerText', alignment: 'center', italics: true },
                                { text: `Pág. ${currentPage} de ${pageCount}`, style: 'footerText', alignment: 'right' }
                            ],
                            margin: [40, 10, 40, 0]
                        }
                    ]
                };
            },

            content: [
                //  (FILA 1: Cliente y Plan) 
                {
                    columnGap: 20,
                    columns: [
                        // DATOS DEL CLIENTE
                        {
                            width: '50%',
                            stack: [
                                { text: 'DATOS DEL CLIENTE', style: 'boxTitle', color: COLORS.primary },
                                { canvas: [{ type: 'line', x1: 0, y1: 0, x2: 230, y2: 0, lineWidth: 1, lineColor: COLORS.border }] },
                                {
                                    style: 'boxContent',
                                    table: {
                                        widths: [60, '*'],
                                        body: [
                                            [{ text: 'Titular:', style: 'label' }, { text: `${cliente.nombres || ''} ${cliente.apellidos || ''}`, style: 'valueBold' }],
                                            [{ text: 'DNI:', style: 'label' }, { text: cliente.dni || '-', style: 'value' }],
                                            [{ text: 'Ubicación:', style: 'label' }, { text: direccionCliente, style: 'value' }],
                                            [{ text: 'Email:', style: 'label' }, { text: cliente.email || '-', style: 'value', fontSize: 8 }]
                                        ]
                                    },
                                    layout: 'noBorders'
                                }
                            ]
                        },
                        // DETALLES DEL PLAN
                        {
                            width: '50%',
                            stack: [
                                { text: 'DETALLES DEL PLAN', style: 'boxTitle', color: COLORS.primary },
                                { canvas: [{ type: 'line', x1: 0, y1: 0, x2: 230, y2: 0, lineWidth: 1, lineColor: COLORS.border }] },
                                {
                                    style: 'boxContent',
                                    table: {
                                        widths: [60, '*'],
                                        body: [
                                            [{ text: 'Plan:', style: 'label' }, { text: plan.nombre || 'N/A', style: 'valueBold', color: COLORS.primary }],
                                            [{ text: 'Tipo:', style: 'label' }, { text: cotizacion.tipo_ingreso || '-', style: 'value' }],
                                            [{ text: 'Grupo:', style: 'label' }, { text: `${(cotizacion.miembros || []).length} personas`, style: 'value' }]
                                        ]
                                    },
                                    layout: 'noBorders'
                                }
                            ]
                        }
                    ]
                },

                { text: '', margin: [0, 10] }, // Separador de filas

                // (FILA 2: Asesor y Vigencia) 
                {
                    columnGap: 20,
                    columns: [
                        // DATOS ASESOR 
                        {
                            width: '50%',
                            stack: [
                                { text: 'DATOS DEL ASESOR', style: 'boxTitle', color: COLORS.primary },
                                { canvas: [{ type: 'line', x1: 0, y1: 0, x2: 230, y2: 0, lineWidth: 1, lineColor: COLORS.border }] },
                                {
                                    style: 'boxContent',
                                    table: {
                                        widths: [60, '*'],
                                        body: [
                                            [{ text: 'Nombre:', style: 'label' }, { text: `${asesor.nombre || ''} ${asesor.apellido || ''}`, style: 'value' }],
                                            [{ text: 'Email:', style: 'label' }, { text: asesor.email || '-', style: 'value', fontSize: 8 }],
                                            [{ text: 'Teléfono:', style: 'label' }, { text: asesor.telefono || '-', style: 'value' }]
                                        ]
                                    },
                                    layout: 'noBorders'
                                }
                            ]
                        },
                        // VIGENCIA 
                        {
                            width: '50%',
                            stack: [
                                { text: 'VIGENCIA', style: 'boxTitle', color: COLORS.primary },
                                { canvas: [{ type: 'line', x1: 0, y1: 0, x2: 230, y2: 0, lineWidth: 1, lineColor: COLORS.border }] },
                                {
                                    style: 'boxContent',
                                    table: {
                                        widths: [80, '*'],
                                        body: [
                                            [{ text: 'Creación:', style: 'label' }, { text: formatDate(cotizacion.fecha_creacion), style: 'value' }],
                                            [{ text: 'Vencimiento:', style: 'label' }, { text: getFechaCaducidad(cotizacion.fecha_creacion), style: 'value', color: '#D32F2F', bold: true }],
                                            [{ text: 'Ingreso Est:', style: 'label' }, { text: getFechaIngreso(cotizacion.fecha_creacion), style: 'value' }]
                                        ]
                                    },
                                    layout: 'noBorders'
                                }
                            ]
                        }
                    ]
                },

                { text: '', margin: [0, 20] },

                // Resto del contenido (Familia, Costos, Prestaciones)
                { text: 'GRUPO FAMILIAR', style: 'sectionHeader', color: COLORS.primary },
                { table: { widths: ['*', 80, 100], body: bodyMiembros }, layout: { hLineWidth: (i) => (i === 1) ? 1 : 0, vLineWidth: () => 0, hLineColor: () => COLORS.primary }, margin: [0, 0, 0, 20] },
                { columns: [ { width: '*', text: '' }, { width: 250, stack: [ { text: 'RESUMEN ECONÓMICO', style: 'sectionHeader', alignment: 'right', color: COLORS.primary }, { table: { widths: ['*', 'auto'], body: bodyCostos }, layout: 'noBorders' }, { text: '* Precios sujetos a modificaciones.', style: 'legalText', alignment: 'right', margin: [0, 5, 0, 0] } ] } ] },
                { text: '', pageBreak: 'before' },
                { text: 'PRESTACIONES DEL PLAN', style: 'pageTitle', color: COLORS.primary, margin: [0, 0, 0, 5] },
                { canvas: [{ type: 'rect', x: 0, y: 0, w: 100, h: 3, color: COLORS.secondary }], margin: [0, 0, 0, 20] },
                { table: { headerRows: 1, widths: ['*', 120, 120], body: parsePrestacionesToBody(plan.detalles || '', COLORS) }, layout: { hLineWidth: function (i, node) { return (i === 0 || i === node.table.body.length) ? 0 : 1; }, vLineWidth: function (i, node) { return 0; }, hLineColor: function (i, node) { return '#EEEEEE'; }, paddingTop: function(i) { return 8; }, paddingBottom: function(i) { return 8; }, fillColor: function (i, node) { return (i === 0) ? COLORS.primary : (i % 2 === 0 ? COLORS.rowOdd : null); } } },
                { text: '', margin: [0, 20] },
                { text: 'CONDICIONES GENERALES', style: 'sectionHeader', color: COLORS.primary },
                { text: plan.condiciones_generales || 'Sin condiciones adicionales.', style: 'bodyText' }
            ],

            styles: {
                logoText: { fontSize: 24, bold: true }, logoSubText: { fontSize: 9, bold: true, letterSpacing: 1 }, headerTitle: { fontSize: 10, bold: true, letterSpacing: 2 }, headerNumber: { fontSize: 16, bold: true }, headerDate: { fontSize: 9 }, boxTitle: { fontSize: 11, bold: true, margin: [0, 0, 0, 5] }, boxContent: { margin: [0, 10, 0, 0] }, sectionHeader: { fontSize: 12, bold: true, margin: [0, 0, 0, 5] }, pageTitle: { fontSize: 18, bold: true }, label: { fontSize: 9, color: '#666666', bold: true }, value: { fontSize: 9, color: '#333333' }, valueBold: { fontSize: 9, color: '#333333', bold: true }, tableHeader: { fontSize: 9, bold: true, margin: [0, 3, 0, 3] }, tableHeaderFilled: { fontSize: 10, bold: true, color: 'white', margin: [0, 5, 0, 5] }, tableRow: { fontSize: 9, margin: [0, 2, 0, 2] }, tableRowCentered: { fontSize: 9, alignment: 'center', margin: [0, 2, 0, 2] }, costLabel: { fontSize: 9, color: '#333' }, costValue: { fontSize: 9, bold: true, alignment: 'right' }, discountLabel: { fontSize: 9, color: '#2E7D32' }, discountValue: { fontSize: 9, color: '#2E7D32', alignment: 'right' }, contributionLabel: { fontSize: 9, color: '#0277BD' }, contributionValue: { fontSize: 9, color: '#0277BD', alignment: 'right' }, totalLabel: { fontSize: 11, bold: true, color: 'white', margin: [5, 5, 0, 5] }, totalValue: { fontSize: 13, bold: true, color: 'white', alignment: 'right', margin: [0, 5, 5, 5] }, footerText: { fontSize: 8, color: '#888888' }, bodyText: { fontSize: 9, color: '#444444', lineHeight: 1.3 }, legalText: { fontSize: 7, color: '#999', italics: true }
            }
        };

        const pdfDoc = printer.createPdfKitDocument(docDefinition);
        pdfDoc.pipe(res);
        pdfDoc.end();
    } catch (error) {
        console.error("ERROR GENERANDO PDF:", error);
        if (!res.headersSent) res.status(500).send("Error al generar PDF"); else res.end();
    }
};

module.exports = { generarCotizacionPDF };